import React from 'react';

function Jumbotron() {
    return (
        <div className="jumbotron">
            <h1 className="text-center"><strong>Googl </strong></h1>
            <h2 className="text-center">Search and save articles from NY Times.</h2>
          </div>
    )
}
export default Jumbotron;
